    @Override
    protected void onResume() {
        super.onResume();

        if(brand==null && motorType==null && date==null){
            items=presenter.getAllItemsSummarize();
        }else{
            items=presenter.getAllByFilter(brand, motorType, date);
            brand=null;
            motorType=null;
            date=null;
        }

        final RecyclerView recyclerView= (RecyclerView) findViewById(R.id.list_content);

        adapter=new CarAdapter(items);

        adapter.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                int pos = recyclerView.getChildAdapterPosition(v);
                presenter.onClickRecyclerViewItem(items.get(pos));
            }
        });

        recyclerView.setAdapter(adapter);

        recyclerView.setLayoutManager(new LinearLayoutManager(this));

        ItemTouchHelper helper = new ItemTouchHelper(new ItemTouchHelper.SimpleCallback(0, ItemTouchHelper.RIGHT) {
            @Override
            public boolean onMove(@NonNull RecyclerView recyclerView, @NonNull RecyclerView.ViewHolder viewHolder, @NonNull RecyclerView.ViewHolder target) {
                return false;
            }

            @Override
            public void onSwiped(@NonNull RecyclerView.ViewHolder viewHolder, int direction) {
                int position = viewHolder.getAdapterPosition();
                if(items.remove(position)!=null){
                    Toast.makeText(ListActivity.this, getResources().getString(R.string.corrected_delete), Toast.LENGTH_SHORT).show();
                    System.out.println(position);
                    adapter.notifyDataSetChanged();
                }else{
                    Toast.makeText(ListActivity.this, getResources().getString(R.string.deleted_failed), Toast.LENGTH_SHORT).show();
                }
            }
        });
        helper.attachToRecyclerView(recyclerView);

    }

